        <ImageBackground style={{height:'100%', position:'relative'}} source={require('../img/sushiBack.jpg')}>
            <View style={{width:'100%', height:'100%',position:'absolute', backgroundColor:'black', opacity:0.5}}></View>
        </ImageBackground>

